import "../styles/components/Navbar.css";
import Logo from "../assets/Logo.svg";
import { Link } from 'react-router-dom';

function Navbar(){

    return(
        <div className="Navbar">
            <button className="Logo"> 
            <Link to="/Roadmap"><img src={Logo} /> </Link>
            </button>
            <div className="Botoes">
                <button id="btn" className="btnRoadmap">
                    <Link to="/Roadmap">ROADMAP</Link>
                </button>
                <button id="btn" className="Carta">
                    <Link to="/CartaDeMotivacao">CARTA DE MOTIVAÇÃO</Link>
                </button>
                <button id="btn" className="Vagas">
                    <Link to="/Vagas">Vagas</Link> 
                </button>
                <button id="btn" className="Sobre">
                    <Link to="/SobreNos">SOBRE NÓS</Link> 
                </button>
            </div>
        </div>
    );
}

export default Navbar;
